import React, {Component } from 'react';
//import {BrowserRouter, Link, Route} from 'react-router-dom';

import styles from './stylesheets/MyProfile.module.css'

class MyProfile extends Component {
    render() {
        return (
            <div className = {styles.ProfilePage}>
               <div className = {styles.profileBox}>
                   <div className = {styles.myName}>
                       <input type="text" id="myname"></input>
                       <input type="text" id="mylastname"></input>
                   </div>
                   <div className = {styles.mymobile}>
                       <input type="text" id="mobile"></input>
                   </div>
                   <div className = {styles.mygender}>
                       <p>Gender</p>
                       <input type="checkbox" id="gendermale">Male</input>
                       <input type="checkbox" id="genderfemale"></input>
                   </div>
                   <input type="date" id="mybirthday"></input>
                   <button type="submit">Update</button>
               </div>
            </div>
        )
    }
}
export default MyProfile;
